export default function sketch(p) {
  p.setup = function() {
    p.createCanvas(600, 400);
  };

  //   p.myCustomRedrawAccordingToNewPropsHandler = function(props) {
  //     if (props.rotation) {
  //       rotation = (props.rotation * Math.PI) / 180;
  //     }
  //   };

  p.draw = function() {
    p.background(0);
    p.noStroke();
    p.fill(255);
    p.ellipse(mouseX, mouseY, 20, 20);
  };
}
